        let item = unsafe { ManuallyDrop::take(&mut self.item) };
        unsafe {
            let _ =
                ManagedRefMut::<M, ManagedVec<M, T>>::wrap_handle(self.managed_vec_handle.clone())
                    .set(self.item_index, item);
        }
        // core::mem::forget(item);
    }
}
